import React from 'react';
import surveyNotFound from '../../style/surveyNotFound/surveyNotFound.module.css'

const NotFoundPage = () => {
	return (
		<div className={surveyNotFound.error}>
			<span>{'404: NOT FOUND'}</span>
		</div>
	);
};

export default NotFoundPage;
